import React, { Fragment, Component } from 'react';
import Link from 'next/link';
import Message from './message'

class Index extends Component {
    state = {
        message: 'props is work'
    };

    render(){
        const { people } = this.props;
        return(
            <div>
                <Link href={'/'}>
                    Home
                </Link>
                <Link as={'/lists'} href={'/lists'} children={Message}>
                    Lists
                </Link>
                <Link as={'/food'} href={'/food'}>
                    Food
                </Link>
                <Link as={'/food/bob'} href={'/[file]/[action]'} >
                    List
                </Link>
                {
                    people.map(e => (
                        <div>
                            <Link as={`/${e.v}/${e.name}`} href={'/[file]/[action]'}>
                                <a> Navigate to { e.v } and {e.name}</a>
                            </Link>
                        </div>
                    ))
                }

                <div>Hello World!</div>
            </div>
        )
    }
}

export default Index;


export async function getStaticProps(context) {

    const people = [
        {v: 'car', name: 'Bruno'},
        {v: 'bike', name: 'John'},
        {v: 'airplane', name: 'Mick'},
        {v: 'sex', name: 'sexy'},
    ];

    // const { index } = context;
    console.log(context);

    // people.push({v: index, name: index});


    return {
        props: {
            people,
        }, // will be passed to the page component as props
    }
}

export async function getStaticPaths() {
    return {
        paths: [
            { params: { index: 'news' } },
            { params: { index: 'hot' } },
            { params: { index: 'search' } },
        ],
        fallback: false  // See the "fallback" section below
    };
}
